INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (190801, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 31001, 7, 1, "2030/12/17 14:59:59", 31, 0.0, 0, "カリン", -409.0, 1, 0, 0.0, "2019/10/31 12:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (190801, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 31002, 8, 1, "2030/12/17 14:59:59", 31, 0.0, 0, "カリン", -409.0, 1, 0, 0.0, "2019/10/31 12:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (190801, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 32001, 1, 1, "2020/01/04 4:59:59", 32, 0.0, 0, "カリン", -409.0, 1, 0, 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (190801, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 32002, 2, 1, "2020/01/04 4:59:59", 32, 0.0, 0, "カリン", -409.0, 1, 0, 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (190801, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 33001, 3, 1, "2020/01/04 4:59:59", 33, 0.0, 0, "カリン", -409.0, 1, 0, 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (190801, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 33002, 4, 1, "2020/01/04 4:59:59", 33, 0.0, 0, "カリン", -409.0, 1, 0, 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (190801, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 34001, 5, 1, "2020/01/10 11:59:59", 34, 0.0, 0, "カリン", -409.0, 1, 0, 0.0, "2020/01/04 5:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (190801, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 34002, 6, 1, "2020/01/10 11:59:59", 34, 0.0, 0, "カリン", -409.0, 1, 0, 0.0, "2020/01/04 5:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (105801, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 38001, 1, 2, "2030/12/17 14:59:59", 38, 5.3, 0, "ペコリーヌ", -458.0, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (105801, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 38002, 2, 2, "2030/12/17 14:59:59", 38, 6.5, 0, "ペコリーヌ", -458.0, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (105801, "", 39005, 0, 3, "2020/04/08 23:59:59", 39, 0.0, 0, "ペコリーヌ", 9999.0, 3, 0, 9999.0, "2020/04/01");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (190801, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 40001, 2, 1, "2030/12/17 14:59:59", 40, 0.0, 0, "カリン", -430.0, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (106401, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 41001, 1, 1, "2030/12/17 14:59:59", 41, 0.0, 0, "シェフィ", -363.0, 1, 2104010, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (105801, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 41002, 1, 1, "2030/12/17 14:59:59", 41, 0.0, 0, "ペコリーヌ", -363.0, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (106001, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 41003, 1, 1, "2030/12/17 14:59:59", 41, 0.0, 0, "キャル", -363.0, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (105901, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 41004, 1, 1, "2030/12/17 14:59:59", 41, 0.0, 0, "コッコロ", -363.0, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (105901, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 42001, 1, 1, "2030/12/17 14:59:59", 42, 0.0, 0, "コッコロ", -416.5, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (106401, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 42002, 1, 1, "2030/12/17 14:59:59", 42, 0.0, 0, "シェフィ", -416.5, 1, 2104010, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (105801, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 42003, 1, 1, "2030/12/17 14:59:59", 42, 0.0, 0, "ペコリーヌ", -416.5, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (106001, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 42004, 1, 1, "2030/12/17 14:59:59", 42, 0.0, 0, "キャル", -416.5, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (105801, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 43001, 1, 1, "2030/12/17 14:59:59", 43, 0.0, 0, "ペコリーヌ", -363.0, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (105901, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 43002, 1, 1, "2030/12/17 14:59:59", 43, 0.0, 0, "コッコロ", -363.0, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (106001, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43003, 1, 1, "2030/12/17 14:59:59", 43, 0.0, 0, "キャル", -363.0, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (123001, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 43004, 1, 1, "2030/12/17 14:59:59", 44, 0.0, 0, "アメス", -416.5, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (123001, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 43005, 2, 1, "2030/12/17 14:59:59", 44, 0.0, 0, "アメス", -416.5, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (123001, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 43006, 3, 2, "2030/12/17 14:59:59", 45, 5.79, 0, "アメス", -416.5, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (123001, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46001, 1, 1, "2030/12/17 14:59:59", 46, 0.0, 0, "アメス", -371.5, 1, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (104901, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 47001, 1, 2, "2030/12/17 14:59:59", 47, 0.0, 0, "シズル", -416.5, 2, 0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (101101, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 47002, 1, 2, "2030/12/17 14:59:59", 47, 9.32, 0, "リノ", -416.5, 1, 0, 0.0, "2015/12/17 15:00:00");
